import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 15.2-1608.2 Salaries of county treasurers.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-1608.2.md","filePath":"vacode/15.2-1608.2.md"}'),o={name:"vacode/15.2-1608.2.md"},s=t('<h1 id="§-15-2-1608-2-salaries-of-county-treasurers" tabindex="-1">§ 15.2-1608.2 Salaries of county treasurers. <a class="header-anchor" href="#§-15-2-1608-2-salaries-of-county-treasurers" aria-label="Permalink to &quot;§ 15.2-1608.2 Salaries of county treasurers.&quot;">​</a></h1><p>The annual salaries of county treasurers or any officers, whether elected or appointed, who hold the combined office of county treasurer and commissioner of the revenue subject to the provisions of § <a href="http://law.lis.virginia.gov/vacode/15.2-1636.17/" target="_blank" rel="noreferrer">15.2-1636.17</a>, shall be as prescribed in the general appropriation act, except as otherwise provided in § <a href="http://law.lis.virginia.gov/vacode/15.2-1636.12/" target="_blank" rel="noreferrer">15.2-1636.12</a>.</p><p>Notwithstanding the repeal of §§ 14-68.1, 14-69, 14-69.1, 14-69.2, 14-69.3 and 14-75, effective July 1, 1964, the prior authority of such sections is continued in effect as to any person holding office on such date.</p><p>Code 1950, §§ 14-69 through 14-69.3; 1952, c. 479; 1956, c. 604; 1960, c. 415; 1964, c. 386, § 14.1-56; 1966, cc. 309, 566, 637; 1970, c. 679; 1972, c. 617; 1974, c. 271; 1976, c. 400; 1977, c. 565; 1979, c. 233; 1980, c. 588; 1983, c. 600; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872" target="_blank" rel="noreferrer">872</a>.</p>',4),c=[s];function i(n,l,f,h,d,p){return r(),a("div",null,c)}const v=e(o,[["render",i]]);export{u as __pageData,v as default};
